import React, { Component } from 'react';
import React360 from './client.bundle.js';

class IndexVR extends Component {

  componentDidMount() {
    React360.init(
      'index.bundle.js',
      document.getElementById('container'),
      {
        assetRoot: 'static/',
      }
    );
  }

  render() {
    return (
      <div id="container"></div>
    );
  }
}

export default IndexVR;
